// Declare app level module which depends on views, and components
angular.module('ehrscapeProvisioner', [
  'ngRoute',
  'ehrscapeProvisioner.home',
  'ehrscapeProvisioner.ehrscapeConfig',
  'ehrscapeProvisioner.requestData',
  'ehrscapeProvisioner.Action'
])

.config(['$routeProvider', function($routeProvider) {
  $routeProvider
    .otherwise({redirectTo: '/'});
}]);

'use strict';

angular.module('ehrscapeProvisioner.ehrscapeConfig', [])

.factory('ehrscapeConfig', function() {

  return {
    baseUrl: 'https://ehrscape.code-4-health.org/rest/v1/',
    username: '',
    password: '',
    sessionId: '',
    fullName: '',
    nhsNumber: '',
    subjectNamespace: 'uk.nhs.hospital_number',
    subjectId: '',
    ehrId: '',
    templateId: 'Vital Signs Encounter (Composition)',
    compositionId: '',
    commiterName: 'ehrscapeProvisioner'
  }

});

